import React, {Component} from 'react';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import SubTitle from "../SubTitle/SubTitle";
import './AboutEducation.css'
import SliderCard from '../SliderCard/SliderCard'
function AboutEducation(props) {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows:false,
    };
    const educationTitleText='Психотерапевтична освіта та практичні навички';
    const educationTitleStyle = {
        color:'white',
        'font-weight': '900',
        padding: '30px 0 30px 0'
    };
        return (
            <div className="about-education-section">
                <div className="container">
                    <SubTitle style={educationTitleStyle} text={educationTitleText}/>
                    <div className="about-education__inner">
                        <Slider {...settings}>
                            <SliderCard text={"Інтернет-магазин ресторану Шаверма Бро"}/>
                            <SliderCard text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard text={"Послуги професійного психолога Марії Шугай"}/>
                            <SliderCard text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard text={"Купуйте автомобільні деталі на Rem Kuzov Chasti"}/>
                        </Slider>
                    </div>
                </div>
            </div>
        );
}

export default AboutEducation;
